import logo from './logo.svg';
import './App.css';
import Test from "./components/Test";
import Toast from "./components/Toast";

function App() {
  return (
    <div className="App">
        <Test/>
        <Toast title={"Toast Title"} message={"Toast Message"} time={3000}/>
    </div>
  );
}

export default App;
